import React from 'react';
import { View, Text, Button} from 'react-native';
import LogoSvg from '../assets/icons/logoSvg';
import HeaderButton from '../components/buttons/headerButton';
import useStyles from './styles/greetingsScreen.module';

function GreetingsScreen() {
    const styles = useStyles();
  return (
    <View style={styles.container}>
      <LogoSvg />
      
    </View>
    
  );
}

GreetingsScreen.navigationOptions = {
    header: () => {
      return (
        <View style={{ backgroundColor: '#fff', borderBottomWidth: 1, borderBottomColor: '#ccc', flexDirection: 'row', alignItems: 'center', justifyContent: 'space-between', paddingHorizontal: 10, paddingVertical: 5, elevation: 3 }}>
          <LogoSvg width={50} height={50} />
          <HeaderButton title="Button Text" onPress={() => console.log('Button Pressed')} />
        </View>
      );
    },
  };

export default GreetingsScreen;
